@Override
public int advance(int target) throws IOException {
  DisiWrapper<Iter> top = subIterators.top();
  do {
    top.doc = top.approximation.advance(target);
    top = subIterators.updateTop();
  } while (top.doc < target);

  return top.doc;
}

